def check_up(i, j):
    if i <= 2:
        return False
    if input[i-1][j] == "M" and input[i-2][j] == "A" and input[i-3][j] == "S":
        return True
    return False
def check_down(i, j):
    if i >= 140 - 3:
        return False
    if input[i+1][j] == "M" and input[i+2][j] == "A" and input[i+3][j] == "S":
        return True
    return False
def check_right(i, j):
    if j >= 140 - 3:
        return False
    if input[i][j+1] == "M" and input[i][j+2] == "A" and input[i][j+3] == "S":
        return True
    return False
def check_left(i, j):
    if j <= 2:
        return False
    if input[i][j-1] == "M" and input[i][j-2] == "A" and input[i][j-3] == "S":
        return True
    return False
def check_left_up(i, j):
    if j <= 2 or i <= 2:
        return False
    if input[i-1][j-1] == "M" and input[i-2][j-2] == "A" and input[i-3][j-3] == "S":
        return True
    return False
def check_left_down(i, j):
    if j <= 2 or i >= 140 - 3:
        return False
    if input[i+1][j-1] == "M" and input[i+2][j-2] == "A" and input[i+3][j-3] == "S":
        return True
    return False
def check_right_down(i, j):
    if j >= 140 - 3 or i >= 140 - 3:
        return False
    if input[i+1][j+1] == "M" and input[i+2][j+2] == "A" and input[i+3][j+3] == "S":
        return True
    return False
def check_right_up(i, j):
    if j >= 140 - 3 or i <= 2:
        return False
    if input[i-1][j+1] == "M" and input[i-2][j+2] == "A" and input[i-3][j+3] == "S":
        return True
    return False

def part_one():
    count = 0;
    for i in range(140):
        for j in range(140):
            if input[i][j] == "X":
                if check_down(i,j): count += 1
                if check_left(i,j): count += 1
                if check_up(i,j): count += 1
                if check_right(i,j): count += 1
                if check_left_down(i,j): count += 1
                if check_left_up(i,j): count += 1
                if check_right_down(i,j): count += 1
                if check_right_up(i,j): count += 1
    return count

def part_two():
    count = 0;
    for i in range(1, 139):
        for j in range(1, 139):
            add_count = False
            if input[i][j] == "A":
                if check_left_down(i-2, j+2) and check_right_down(i-2, j-2):
                    add_count = True
                if check_left_down(i-2, j+2) and check_left_up(i+2, j+2):
                    add_count = True
                if check_left_up(i+2, j+2) and check_right_up(i+2, j-2):
                    add_count = True
                if check_right_up(i+2, j-2) and check_right_down(i-2, j-2):
                    add_count = True
                if add_count:
                    count+=1
    return count
                

def main():
    print(part_one())
    print(part_two())

main()